  const [patientData, setPatientData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get("https://fedskillstest.coalitiontechnologies.workers.dev", {
          headers: {
            'Authorization': `Basic ${btoa('coalition:skills-test')}`
          }
        });
        setPatientData(response.data[0]); // Assuming data is an array and we're using the first object
        setLoading(false);
      } catch (error) {
        console.error("There was an error fetching the patient data!", error);
        setError(error);
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error.message}</div>;
  if (!patientData) return <div>No Data Available</div>;

  const chartData = {
    labels: [
      "Oct 2023",
      "Nov 2023",
      "Dec 2023",
      "Jan 2024",
      "Feb 2024",
      "Mar 2024",
    ],
    datasets: [
      {
        label: "Systolic",
        data: patientData.diagnosis_history.map(d => d.blood_pressure.systolic.value),
        borderColor: "#FF6384",
        fill: false,
      },
      {
        label: "Diastolic",
        data: patientData.diagnosis_history.map(d => d.blood_pressure.diastolic.value),
        borderColor: "#36A2EB",
        fill: false,
      },
    ],
  };

  const options = {
    responsive: true,
    plugins: {
      legend: {
        position: "top",
      },
      tooltip: {
        callbacks: {
          label: function (tooltipItem) {
            return tooltipItem.dataset.label + ": " + tooltipItem.raw;
          },
        },
      },
    },
    scales: {
      y: {
        beginAtZero: false,
      },
    },
  };

  return (
    <div>
      <div className="mt-[10px] ml-[400px] left-[18px] w-[766px] h-[735px] opacity-100 bg-[#FFFFFF] rounded-[16px] ">
        <div className="m-[15px]">
          <div className="bg-white p-6 rounded-lg shadow-md">
            <h2 className="text-2xl font-bold mb-4">Diagnosis History</h2>
            <Line data={chartData} options={options} />
          </div>
        </div>
        <div className="flex justify-between m-[15px] opacity-100">
          <div className="bg-[#E0F3FA] rounded-[12px] p-4 w-[228px] h-[242px] flex flex-col items-center justify-center relative">
            <img
              src={cardimg1}
              alt="Respiratory Rate Icon"
              className="rounded-full w-[120px] h-[120px] absolute top-[0px] left-[0px] p-[16px]"
            />
            <p className="text-[16px] font-medium mt-[100px]">Respiratory Rate</p>
            <p className="text-[30px] font-extrabold text-gray-600">20 bpm</p>
            <p className="mt-[10px] text-[14px] text-gray-500">Normal</p>
          </div>
          <div className="bg-[#FFE6E9] rounded-[12px] p-4 w-[228px] h-[242px] flex flex-col items-center justify-center relative">
            <img
              src={cardimg2}
              alt="Temperature Icon"
              className="rounded-full w-[120px] h-[120px] absolute top-[0px] left-[0px] p-[16px]"
            />
            <p className="text-[16px] font-medium mt-[100px]">Temperature</p>
            <p className="text-[30px] font-extrabold text-gray-600">98.6Â°F</p>
            <p className="mt-[10px] text-[14px] text-gray-500">Normal</p>
          </div>
          <div className="bg-[#FFE6F1] rounded-[12px] p-4 w-[228px] h-[242px] flex flex-col items-center justify-center relative">
            <img
              src={cardimg3}
              alt="Heart Rate Icon"
              className="rounded-full w-[120px] h-[120px] absolute top-[0px] left-[0px] p-[16px]"
            />
            <p className="text-[16px] font-medium mt-[100px]">Heart Rate</p>
            <p className="text-[30px] font-extrabold text-gray-600">78 bpm</p>
            <p className="mt-[10px] text-[14px] text-gray-500">Lower than Normal</p>
          </div>
        </div>
      </div>
      <div className="mt-[10px] ml-[400px] left-[18px] w-[766px] h-[358px] opacity-100 bg-[#FFFFFF] rounded-[16px]">
        <h1 className="text-[24px] font-extrabold p-[20px]">Diagnostic List</h1>
        <div className="flex justify-between bg-[#F6F7F8] rounded-[24px] h-[48px] w-[726px] items-center py-[14px] px-[30px] ml-[20px] font-bold">
          <p className="w-[30%]">Problem/Diagnosis</p>
          <p className="w-[40%]">Description</p>
          <p className="w-[30%]">Status</p>
        </div>
        <div className="h-[59px] w-[723px] flex flex-row py-[14px] mt-[11px] overflow-hidden">
          {patientData.diagnostic_list.map((diag, index) => (
            <div key={index} className="flex w-full">
              <p className="flex-none w-[30%] pl-[50px]">{diag.name}</p>
              <p className="flex-none w-[40%] pl-[55px]">{diag.description}</p>
              <p className="flex-none w-[30%] truncate">{diag.status}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
